import React from 'react';


function SkillTag({ skill }) {
  return (
    <div className="overflow-hidden text-sm gap-2.5 self-stretch underline underline-offset-1 decoration-2 decoration-[#F384D4] ">
      <span className="px-2">
        {skill}
      </span>
    </div>
  );
}

export default SkillTag;
